My 92.9 is at Homer Davis Elementary.
February 4 at 2:24 PM · Tucson, AZ ·

@cyndila stopped by Homer Davis to read to Mrs Nichol’s kindergarten class and Mrs Hendrick’s 5th grade class for love of reading month! It was so much fun. Thanks for having us, and keep on reading 📚 📖 👀❤️ #loveofreading #radio #tucson #communityinvolvement @ Homer Davis Elementary
